import React from 'react'

import "../custom.scss"

export default function School({ school }) {
  return (
    <p>
          <b>{school.degree}</b><br></br>
          <span class="dgrey"> {school.institution} - <span>{school.date}</span> - {school.grade} <br></br> </span>
          {school.description}<br></br>
    </p>
  )
}
